import React from "react";
import './Paged.css';



export default function Paged({ pokePerPage, pokemons, paged }) {
  let pagedNumbers = [];
  for (let i = 1; i <= Math.ceil(pokemons / pokePerPage); i++) {
    pagedNumbers.push(i)
  }

  return (
    <div className="paged">
      <div className="lista">
        {pagedNumbers && pagedNumbers.map((number, i) => (
          <div className="anchor">
            <p className="anchor" key={i} onClick={() => paged(number)}>{number}</p>
          </div>
        ))}
      </div>
    </div>

  )
}
